import { withRouter } from "next/router";
import React from "react";

const Test = withRouter((props) => {
  console.log(name, promise);
  return (
    <>
      <p>{router.query.id}</p>
      <p>{name}</p>
      <p>1111111111</p>
    </>
  );
});

Test.getInitialProps = async ctx => {
  const promise = new Promise(resolve => {
    setTimeout(() => {
      resolve({ name: "linbudu" });
    }, 1000);
  });
  return { ...promise };
};

export default Test;
